import React from "react";
import Pdf from "react-to-pdf";


const ref = React.createRef();

const PDF = (props) => {
  return(
  <>
     <div className="Post" ref={ref}>

     </div>
     <Pdf targetRef={ref} filename="post.pdf">
     {({ toPdf})} => <button onClick={toPdf}>Download Transactions
     </button>
     </Pdf>
    </>
   )
}


export default PDF;
